import React from 'react';
import { useState } from 'react';
import {Link} from 'react-scroll'; 
import b4la from '../Images/B4LA.mp4'; 
import group from '../Images/group2.png';
import baum from '../Images/baum.png';
import wires from '../Images/wires.png';
import fight from '../Images/fight.png';
import repair from '../Images/repair.png'; 
import ImageSlider from "./ImageSlider"; 


const Gallery = () => {
    const slides = [
        {url: "http://localhost:3000/B4LA.mp4", title: 'Competition'},
        {url: "http://localhost:3000/group2.png", title: 'GroupPhoto'},
        {url: "http://localhost:3000/repair.png", title: 'Assembly'},
        {url: "http://localhost:3000/wires.png", title: 'Wiring'},
        {url: "http://localhost:3000/baum.png", title: 'Baum'},
        {url: "http://localhost:3000/fight.png", title: 'RobotsFighting'},
    ]; 

    const containerStyles = {
        width: "500px",
        height: "280px",
        margin: "0 auto",
    };

    return (
        <section id="gallery">
            <div style={containerStyles}>
                <ImageSlider slides={slides}></ImageSlider>
            </div>
            {/*<video width="750" height="500" controls >
            <source src={b4la} type="video/mp4"/>
            </video>*/}
        </section>
    ); 
}

export default Gallery;
